import React,{Component} from 'react';



class Lista extends Component{
    constructor(props){
        super(props);
        this.state = {
            id:"",
            entrada:"",
            items:[]

        }
    }

    render(){

        return (
        <div>
            <form>
                <div className="form-group">
                    <label for="tnome">Nome: </label>

                </div>
            </form>
        </div>
        )
    }




}
